INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (321, 0, 1, 24001, 1, 2, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, "リリ", 1, 40011);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (322, 0, 1, 24001, 2, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, "クリア", 1, 40011);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (323, 0, 1, 24001, 3, 2, "んーと。\nこれ、あげる。\nはい", 126101, "プレシア", 1, 40011);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (324, 0, 1, 24001, 4, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, "リリ", 2, 40011);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (325, 0, 1, 24001, 5, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, "クリア", 2, 40011);
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (326, 0, 1, 24001, 6, 2, "お兄。\nきてくれて、うれしい", 126101, "プレシア", 2, 40011);
